class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verifies that setting a valid birth date and retrieving it returns the same date")
	void testSetBirthDateHappyPath() {
		var result = instance.setBirthDate(new Pet());
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that setting birth date to null and retrieving it returns null")
	void testSetBirthDateWithNull() {
		var result = instance.setBirthDate(new Pet());
		assertNotNull(result);
	}

	@Test
	@DisplayName("Sets birth date then gets it to ensure the value is stored correctly")
	void testSetBirthDateAndGet() {
		var result = instance.setBirthDate(new Pet());
		assertEquals(LocalDate.of(1995, 12, 1), result);
	}

	@Test
	@DisplayName("Verifies that getting birth date on a new pet returns null by default")
	void testGetBirthDateDefault() {
		var result = instance.setBirthDate(new Pet());
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns the value assigned to the birthDate field")
	void testGetBirthDateReturnsSetValue() {
		var result = controller.getBirthDate();
		assertEquals(LocalDate.of(2020, 5, 15), result);
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns null when the birthDate field is null")
	void testGetBirthDateReturnsNullWhenUnset() {
		var result = controller.getBirthDate();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Test that setType can set the type to null without throwing an exception")
	void testSetTypeWithNull() {
		var result = instance.setType("null");
		assertNotNull(result);
	}

	@Test
	@DisplayName("Test that getVisits returns the pet's visits collection, initially empty")
	void testGetVisits() {
		var result = instance.setType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify that a valid Visit is successfully added to the Pet's visits list.")
	void testAddVisitHappyPath() {
		instance.addVisit(new Pet());
	}

	@Test
	@DisplayName("Verify that adding a null Visit throws a NullPointerException.")
	void testAddVisitNull() {
		assertThrows(NullPointerException.class, () -> {
			instance.addVisit(new Pet());
		});
	}

	@Test
	@DisplayName("Verify that a Visit with an empty description is added without issue.")
